import React from 'react'
import styled from "styled-components"
import switchB from './media/switch.png'
import switchBi from './media/switchi.png'
import CrossfadeImage from 'react-crossfade-image'

const Toggle = ({theme,  toggleTheme}) => {
    return (
     <CrossfadeImage style={{ maxWidth: '10%', maxHeight: '10%' }} onClick={toggleTheme} src={theme === 'light' ? switchBi : switchB} duration='460' timingFunction='linear' />
    );
};

export default Toggle
